import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './header';
import Footer from './footer';
import Main from './main';  // Головна сторінка
import Catalog from './catalog';  // Сторінка каталогу

function App() {
  return (
    <Router>
      <div>
        <Header />
        <Routes>
          <Route path="/" element={<Main />} /> {/* Головна сторінка */}
          <Route path="/catalog" element={<Catalog />} /> {/* Сторінка каталогу */}
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
